let Sides = (props) =>{
    let  source  = props.source;
    console.log(source);
    return(
        <div className="image-container" style={{display:"flex" }}>
                    <img style={{ width:"100%", height:"100%" ,
                    }} src={source} alt="Image" />
                </div>
    )
}
export default Sides;
